import { enumStatus, enumTypes, enumUnit, exchangedType } from "@configs";

export interface ICoupon {
    exchangedType?: exchangedType,
    updatedAtHistory:Date|string,
    idCart?: string,
    _id?: string;
    name: string;
    code?: string;
    levelIds: Array<string> | undefined;
    status: enumStatus;
    qrToken: string;
    quantity: number;
    limit: number;
    imageUrl: Array<string>;
    guideline?: string;
    startDate: Date | string;
    endDate: Date | string;
    qrImageLink: string;
    benefit: number;
    unit?: enumUnit | string;
    type?:enumTypes;
}

export interface IReceive {
    objectId: string;
    type: enumTypes;
    status: enumStatus;
    quantity?:number,
    variants?:string[];
    points?:number;
}

export interface ICouponList {
    merchantId:string;
    objectId:string;
    userId:string;
    qrtable:ICoupon;
}
